import logo from "./logo.svg";
import "./App.css";
import Item from "./components/Item.jsx";
import PromptBox from "./components/PromptBox.jsx";
import List from "./components/List.jsx";

function App() {
  const depts = [
    {
      name: "Dairy",
      items: [
        {
          name: "Milk",
          description: "Red Cap Milk, Check for Expiry",
          count: "2",
        },
      ],
    },
    {
      name: "Produce",
      items: [
        { name: "Tomato", description: "Get Ripe Ones", count: "12" },
        { name: "Potatoes", description: "Small Baby, in a Bag", count: "12" },
      ],
    },
  ];

  return (
    <div className="App">
      <List departments={depts} />
      <PromptBox />
    </div>
  );
}

export default App;
